webpackJsonp([95451619774852],{376:function(e,n){e.exports={data:{post:{html:'<p>This is the last Oxygen beta version release. </p>\n<p>It is not a final release because migration process from 1.11 to 2.0 is not ready yet.</p>\n<h2 id="migrations"><a href="#migrations" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Migrations</h2>\n<h3 id="from-a-docker-installation"><a href="#from-a-docker-installation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>from a docker installation</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>docker-compose stop web\ndocker-compose rm web \ndocker-compose build web\ndocker-compose up -d\n# migrate the AP / CC inverse key\ndocker-compose exec web php bin/console doctrine:migrations:execute 20170320153305\n# migrate add suiveur Qualite on an etude\ndocker-compose exec web php bin/console doctrine:migrations:execute 20170327090019</code></pre>\n      </div>\n<h2 id="changelog"><a href="#changelog" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Changelog</h2>\n<p>Since beta-2 we have : </p>\n<ul>\n<li>\n<p>Fix 2 minor security issue : </p>\n<ul>\n<li>an admin can\'t delete a superadmin anymore, </li>\n<li>add a csrf protection on user creation</li>\n</ul>\n</li>\n<li>Minor UI improvement, namely link to github in the footer, consistency among pages</li>\n<li>\n<p>Fix several bugs : </p>\n<ul>\n<li>hardcoded value for notification emails</li>\n<li>minor undefined field on gantt chart</li>\n<li>inversed owner relation between AP and CC (see the associated migration)</li>\n</ul>\n</li>\n<li>Improved code quality (platinum is back !)</li>\n<li>Improve Avant Projet doctype</li>\n<li>Add a field for quality manager on each Etude</li>\n</ul>\n<p>{% include links.html %}</p>'},navDoc:{edges:[{node:{title:"Installation",path:"install",items:[{id:"environment",title:"Environment",anchors:null},{id:"index",title:"Install Jeyser in minutes",anchors:null},{id:"update",title:"Update Jeyser",anchors:null},{id:"annexes",title:"Annexes",anchors:[{id:"help-for-manual-installation",title:"Help for manual installation"},{id:"ssh-key-connection",title:"SSH Key Connection"}]}]}},{node:{title:"Features",path:"features-fr",items:[{id:"gestion-associative",title:"Gestion associative",anchors:null},{id:"suivi-projet",title:"Suivi de projet",anchors:null},{id:"prospection",title:"Prospection",anchors:null},{id:"rh",title:"Relations humaines",anchors:null},{id:"tresorerie",title:"Trésorerie",anchors:null},{id:"formations",title:"Formations",anchors:null},{id:"indicateurs",title:"Indicateurs",anchors:null},{id:"documents-types",title:"Documents types",anchors:null},{id:"documents-types-faq",title:"FAQ Documents types",anchors:null},{id:"administration",title:"Administration",anchors:null},{id:"gdpr",title:"Règlement général sur la protection des données",anchors:null}]}},{node:{title:"User guides",path:"user-guides",items:[{id:"introduction-to-jeyser-1",title:"Introduction to Jeyser",anchors:null}]}},{node:{title:"Development",path:"dev",items:[{id:"faq",title:"FAQ",anchors:null},{id:"docker-architecture",title:"Architecture Docker",anchors:null},{id:"about",title:"About",anchors:null},{id:"demo-data",title:"Demo data",anchors:null},{id:"contributing",title:"Contributing",anchors:null}]}}]}},pathContext:{path:"docs/news/2017-05-17-oygen-beta3-release"}}}});
